import React from "react";
import { Icon } from "semantic-ui-react";
// import Icon from "@bit/semantic-org.semantic-ui-react.icon";
// import StyleLinks from "@bit/semantic-org.semantic-ui-react.internal.style-links";

const Footer = () => (
  <footer>
    <div class="links">
      <a>
        <Icon enable name="github" size="huge"></Icon>
      </a>
      <a>
        <Icon class="linkedin square big icon"></Icon>
      </a>
      <a>
        <Icon class="stack overflow big icon"></Icon>
      </a>
    </div>
  </footer>
);
export default Footer;
